import React, { Component } from 'react';

class chieldberanda extends Component {
    render() {
        return (
            <div id="content">
            <div className="inner" >
                <div className="row">
                    <div className="col-lg-12">

                    <div className="App">
                    <header className="App-header">
                    <img src={logo} className="App-logo" alt="logo" />
      
                    </header>
                     </div>
                        


                    </div>
                </div>
                <hr />
            </div>
        </div>
        );
    }
}

export default chieldberanda;
